import React from 'react';
import ReactDOM from 'react-dom/client';
import styles from './assets/css/mainMenu.module.css'
import logo from './gf.svg'

function mainMenu() {
const menu = (
  <div className={styles.menuContainer}>
    <div className={styles.logo}>
      <a href='' style={{cursor:'pointer'}}><img src={logo}/></a>
    </div>
    <div className={styles.menuItemsWrapper}>
      <ul className={styles.menuItems}>
        <li className={styles.menuItem}><a href=''>About</a></li>
        <li className={styles.menuItem}><a href=''>About</a></li>
        <li className={styles.menuItem}><a href=''>About</a></li>
      </ul>
    </div>
    <div className={styles.MenuRightContact}>
      <a href=""><button className={styles.menuContact}>I WANT RESULTS</button></a>
    </div>
  </div>
);
return menu
}

export default mainMenu;
